    _fxLink = fxLink;
    _hourly = hourly;
    _refer = refer;
}

  HourlyWeatherBean.fromJson(dynamic json) {
    _code = json['code'];
    _updateTime = json['updateTime'];
    _fxLink = json['fxLink'];
    if (json['hourly'] != null) {
      _hourly = [];
      json['hourly'].forEach((v) {
        _hourly?.add(Hourly.fromJson(v));
      });
    }
